    "2013-03-16T01:05:54.127878",nt"name": "blm-row-energy-corridors",nt"isopen":
    false,nt"url": null,nt"notes": "This service shows Bureau of Land Management
    (BLM) Solar Energy Study Zones and Section 368 federal energy corridors. The Solar
    Energy Study Zones are from the Solar Energy Development Programmatic Environmental
    Impact Statement (PEIS). The section 368 energy corridors have been designated (per
    the requirements of Section 368 of the Energy Policy Act of 2005) as West-wide energy
    corridors for the final "Programmatic Environmental Impact Statement, Designation
    of Energy Corridors on Federal Land in the 11 Western States", November 2008. The
    Section 368 energy corridors contained in this map service are shown where they
    intersect BLM lands and contain centerline and corridor zones showing electric transmission,
    upgrade existing electrical transmission, underground energy infrastructure and
    all uses categories.n",nt"license_title": null,nt"extras": [{ntt"key":
